def yosh_hisobla(ism, tugilgan_yil):    """Foydalanuvchisan ismi va tugilgan yinini sorab hisoblaydigan funksiya"""    print(f"Assalomu alaykum {ism.title()} sizning yoshingiz {2023-tugilgan_yil} da!")yosh_hisobla("Fahriddin", 1989)def son_olib():    """Foydalanuvchidan son olib kvadrati va kubini qaytaruvchi funksiya"""    kiritilgan_son=(input("Biron bir son kiriting"))    berilgan=int(kiritilgan_son)    print(f"{berilgan**2}, {berilgan**3} ")son_olib()def toq_juft_aniqla():    """foydalanuvchidan son olib toq yakida juft ligini aniqlaydigan funksiya"""    berilga_son=input("biron son kiriting")    ineger_qil=int(berilga_son)    if ineger_qil%2==0:        print("kiritgan soningiz juft ekan!!!")    else:       print("kiritilgan son toq son ekan!!!")toq_juft_aniqla()def sonlarni_farqla(bir):    """Bu dastur sozdan biron son oladida uni 1dan 10gacha bo'lgan sonlar orlig'ida qaysi songa qoldiqsiz bo'linishini rekshiradi va console ga chiqaradi"""        for n in range(2,11):        if  bir%n:            print(f"{bir} soni {n} ga qoldiqsiz bo\'linadi")